import React from 'react'
import Logo from './../img/Sabor_Badalona.png';
import { Link } from 'react-router-dom';


const handleDestroySession = () => {
  sessionStorage.removeItem('username');
  sessionStorage.removeItem('role');
  window.location.href = '/loginUser';
};
export default function HeaderAdmin() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark">
        <div className="container-fluid">
            <div className="d-flex align-items-center">
              <a href='/homeadmin'><img src={Logo} alt="Logo" width="200" height="2npc00" className="me-2 img-fluid" /></a>
            </div>

              <div className="collapse navbar-collapse" id="navAdmin">
                <ul className="my-list navbar-nav mb-8 mb-lg-0">
                  <li className="nav-item">
                    <a className="nav-link" href="/verPlatos">Platos</a>
                  </li>

                  <li className="nav-item">
                    <a className="nav-link" href="/verMesas">Mesas</a>
                  </li>

                  <li className="nav-item">
                    <a className="nav-link" href="/verReservas">Reservas</a>
                  </li>
                </ul>
                
                {/* <form className="d-flex">
                  <input className="form-control me-2" type="search" placeholder="Buscador" aria-label="Buscador" />
                  <button className="btn btn-outline-light" type="submit">Buscar</button>
                </form> */}
            </div>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            {sessionStorage.getItem("username") ? (
                <div>
                  <button className='btn btn-outline-primary logout-btn' onClick={handleDestroySession}>LogOut</button>
                </div>
            ) : (
                <div>
                  <Link className='btn btn-outline-primary logout-btn' to="/loginUser">Login</Link>
                </div>
            )}
            
          </div>
      </nav>
    </div>
  )
}
